import React, { useEffect } from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";
import Swiper from "swiper";

const HomeConts3 = () => {
  useEffect(() => {
    // Swiper 초기화
    const swiper = new Swiper(".swiper-container", {
      // Swiper 옵션 설정
      // 여기에 원하는 옵션들을 추가하면 됩니다.
      centeredSlides: true,
      slidesPerView: "auto",
      spaceBetween: 30,
      navigation: {
        nextEl: ".swiper-button-next",
        prevEl: ".swiper-button-prev",
      },
    });

    return () => {
      // 컴포넌트 언마운트 시 Swiper 파기
      swiper.destroy();
    };
  }, []);

  return (
    <FullpageSection>
      <h1>Section3</h1>
    </FullpageSection>
  );
};

export default HomeConts3;
